rawCSS:
body {
  margin: 0;
  font-family: 'Roboto', sans-serif;
  height: 100vh;
  display: flex;
  height: 100vh;
  flex-direction: column;
}
h1 {
  font-size: 5.5vmin;
  margin: 0;
  color: white;
  font-weight: 500;
  background-color: black;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  height: 15.2vmin;
  box-shadow: 0 0.5vmin 0.5vmin 0 rgba(255,0,0,1.0);
  flex-grow: 0;
  flex-shrink: 0;
  z-index: 2;
}
.hleft {
  display: flex;
  flex-direction: row;
  flex-shrink: 0;
  flex-grow: 0;
  padding-left: 5vmin;
  padding-right: 9.7vmin;
}
.htitle {
  flex-grow: 1;
}
.hright {
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
}
.hricon {
  padding-right: 5vmin;
}
.body {
  display: flex;
  flex-direction: column;
  flex-grow: 1;
  flex-shrink: 1;
}
.sms-them {
  display: flex;
  flex-direction: row;
  width: 100%;
}
.them-spacer {
  min-width: 33vmin;
  flex-grow: 0.85;
}
.them-message {
  background-color: aqua;
  padding-top: 3.6vmin;
  padding-bottom: 5.0vmin;
  padding-left: 4.3vmin;
  padding-right: 4vmin;
  margin-left: -2vmin;
  margin-right: -3vmin;
  font-size: 5vmin;
  color: white;
  font-size: 4vmin;
  font-weight: 600;
  border-radius: 1vmin 1vmin 0vmin 1vmin;
}
.rwedge-container {
  display: flex;
  margin-left: 3vmin;
  flex-direction: column;
  margin-right: -3vmin;
}
.rwedge-top {
  flex-grow: 1;
  flex-shrink: 1;
}
.rwedge {
  width: 3.2vmin;
  height: 3.2vmin;
  border-width: 1.6vmin;
  border-style: solid;
  border-color: transparent transparent aqua aqua;
  box-sizing: border-box;
  flex-grow: 0;
  flex-shrink: 0;
}
.input {
  display: flex;
  flex-direction: row;
  flex-grow: 0;
  flex-shrink: 0;
  align-items: center;
  height: 18vmin;
  font-size: 8vmin;
  z-index: 2;
  box-shadow: 0 -0.5vmin -0.5vmin 0 rgba(255,0,0,1.0);
}
.emoji {
  flex-grow: 0;
  flex-shrink: 0;
  margin-left: 5.5vmin;
}
.standin {
  margin-top: 1.0vmin;
  font-size: 4.6vmin;
  flex-grow: 1;
  flex-shrink: 1;
  margin-left: 5.5vmin;
}
.send {
  margin-right: 6.5vmin;
  font-size: 10vmin;
}
